const ref = await refs.getOne("*");
const events = series.current(ref);
events
  .filter((event) => event.value !== null)
  .filter((event) => {
    let valid = true;
    if (ref.range_lower !== null) {
      valid = valid && parseFloat(ref.range_lower) <= event.value;
    }
    if (ref.range_upper !== null) {
      valid = valid && parseFloat(ref.range_upper) >= event.value;
    }
    return valid;
  })
  .filter((event) => ref.validity_intervals.some(
    ({from, to}) => utils.timestampInInterval(event["@timestamp"], from, to),
  ))
  .forEach((event) => series.save(event.value, event["@timestamp"]));

