const events = series.current("*.valid-parameters.*");
if (events.length > 0) {
  const ref = await refs.getOne("*.parameters.*");
  if (events.some((event) => event.value === 0)) {
    series.save(2);
  } else {
    const lowerThresholds = ref.active_thresholds
          .filter((t) => t.lower !== null)
          .map((t) => parseFloat(t.lower));
    if (events.some((event) => lowerThresholds.some((t) => event.value < t))) {
      series.save(1);
    } else {
      series.save(0);
    }
  }
}

const events = series.current("*.valid-parameters.*");
if (events.length > 0) {
  const ref = await refs.getOne("*.parameters.*");
  const maxValue = Math.max(...events.map((event) => event.value));
  const upperThresholds = ref.active_thresholds
        .filter((t) => t.upper !== null)
        .map((t) => parseFloat(t.upper));
  const excess = upperThresholds.filter((t) => maxValue > t).length;
  series.save(excess);
}

