const heads = await series.query([
  // Eventos críticos
  {head: "*.terremoto-7"},
  {head: "*.deslizamiento-critico"},
  {head: "*.rebalse"},
  // Evaluación cualitativa
  {head: "*.triggers"},
  {head: "*.design"},
  {head: "*.vulnerability"},
]);
const criticalEvents = heads.slice(0, 3);
if (criticalEvents.some((e) => utils.isDefined(e) && e.value > 0)) {
  series.save(3);
  return;
}
const {value: valorE} = heads[3];
const {value: valorD} = heads[4];
if (valorE === 0 && valorD === 0) {
  series.save(0);
  return;
}
if (valorE >= 2 || valorD >= 2) {
  series.save(2);
  return;
}
const {value: valorV} = heads[5];
if (valorV > 60 && (valorD > 0 || valorE > 0)) {
  series.save(2);
} else if (valorV > 30 && valorD > 0 && valorE > 0) {
  series.save(2);
} else {
  series.save(1);
}

