const heads = await series.queryAll({head: "*"}).then((events) => events.filter(utils.isDefined));
if (heads.length > 0) {
  const previous = await series.query({head: ctx.rootRef});
  // risk is 0, if no variable is below threshold
  // risk is 1 + previous risk value, otherwise
  series.save(
    heads.some(({value}) => value > 0.5) ?
      (1 + (utils.isDefined(previous) ? previous.value : 0)) :
      0,
  );
}

