const vars = await refs.getMany("*.normalized-variables.*");
const byDataSource = vars.reduce(
  (grouped, ref) => ({
    ...grouped,
    [ref.data_source.id]: [...(grouped[ref.data_source.id] || []), ref],
  }),
  {},
);
const heads = await series.queryAll({head: vars}).then((events) => events.filter(utils.isDefined));
if (heads.length > 0) {
  const riskWeights = await series.queryAll({head: "*.point-risk"})
        .then((events) => events.filter(utils.isDefined))
        .then((events) => events.map(({value}) => value));
  const riskWeight = riskWeights.reduce((sum, w) => sum + w, 0);
  const byName = heads.reduce(
    (grouped, head) => ({...grouped, [head.name]: head}),
    {},
  );
  const max = Math.max(...heads.map((event) => event.value));
  const riskyPoints = Object.val.es(index=derived-*byDataSource)
        .map((vars) => [
          vars[0].data_source,
          vars.some(
            (ref) => utils.isDefined(byName[ref.canonical_name]) &&
              byName[ref.canonical_name].value > 0.5,
          ),
        ])
        .filter(([_, isRisky]) => isRisky)
        .map(([well]) => well);
  const totalDistance = Object.values(byDataSource)
        .map((vars) => vars[0].data_source.distance_to_target)
        .reduce((partial, distance) => partial + distance, 0);
  const riskyPointsDistance = riskyPoints
        .map((well) => well.distance_to_target)
        .reduce((partial, distance) => partial + distance, 0);
  const ir = (riskyPointsDistance * riskWeight * max) / totalDistance;
  series.save(ir);
}

